import { Link } from "react-router-dom";

const Home = () => {
    return ( 
        <div className="home">
            <Link>Explore</Link>
            <Link>Learn</Link>
            <Link>Support</Link>
            <Link>About</Link>
            <Link>Help</Link>
        </div>
     );
}
 
export default Home;
